import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import './App.css';

// Define the ReportTime component within App.js
function ReportTime() {
  // Function to navigate to a new website
  const navigateTo = (url) => {
    window.location.href = url;
  };

  return (
    <div className="report-time-container">
      <h1>How many hours did you drive today?</h1>
      <div className="buttons-container">
        <button onClick={() => navigateTo('http://example.com/6hour')} className="time-button">6 Hour</button>
        <button onClick={() => navigateTo('http://example.com/8hour')} className="time-button">8 Hour</button>
        <button onClick={() => navigateTo('http://example.com/9hour')} className="time-button">9 Hour</button>
      </div>
    </div>
  );
}

// Define the main App component
function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={
          // Your home page component or content here
          <div>
            <h2>Home Page</h2>
            {/* Home page content */}
          </div>
        } />
        <Route path="/report" element={<ReportTime />} />
        {/* Add other routes here */}
      </Routes>
      <nav className="App-nav">
        <Link to="/" className="nav-button">Home</Link>
        <Link to="/report" className="nav-button">Report Time</Link>
        {/* Add other navigation links here */}
      </nav>
    </Router>
  );
}

export default App;
